import React from "react";

export const MoviesList = ({ movies, onMovieSelected }) => {
  return (
    <>
      <ul>
        {movies.map((m) => (
          <li key={index}><p onclick={onMovieSelected(m.id)}>{m.title}</p></li>
        ))}
      </ul>
    </>
  );
};
